contracts/supplierManufacturer.sol.content:
// SPDX-License-Identifier: GPL-3.0
import "./Interfaces/ISupplierManufacturer.sol";
pragma solidity >=0.8.0 <=0.8.19;

/// @author ProvyLens team
/// @title The contract for handling transfer between supplier and manufacturer product
/// @notice Uses ISupplierManufacturer interface

contract supplierManufacturer is ISupplierManufacturer{
    uint public smId = 1;
    uint public reqId =1;

    // struct
        //   uint sp_id;
        //   address supplierAddress;
        //   address manufacturerAddress;
        //   uint32 dispatchTime;
        //   uint32 arrivalTime;

    // events
        // eventSupplierManufacturerTransfer
        // eventArrivalTime

    /// @notice mapping smId index with supplierManufacturer
    mapping(uint => supplierManufacturer) public smIdToStructMapping;
    mapping(uint => requestDetails) public reqIdToDetailsMapping;
    mapping(address => uint[]) public supplierToRequestMapping;
    mapping(address => uint[]) public manufacturerToRequestMapping;


    /// @notice mapping address with all the created smIds
    mapping(address => uint[]) public manufacturerTosmIdMapping;

    /// @notice function to transfer product from supplier to manufacturer
    function transferProduct(uint _spId, address _supplierAddress,address _manufacturerAddress,uint32 _dispatchTime)external override{
        smIdToStructMapping[smId] = supplierManufacturer(_spId,_supplierAddress,_manufacturerAddress,_dispatchTime,0);
        manufacturerTosmIdMapping[_manufacturerAddress].push(smId);
        emit eventSupplierManufacturerTransfer(smId,_spId,_supplierAddress,_manufacturerAddress,_dispatchTime);
        smId++;
    } 

    /// @notice function to update that the product has been received
    function receiveProduct(uint _smId)external override{
        smIdToStructMapping[_smId].arrivalTime = uint32(block.timestamp);
        emit eventArrivalTime(uint32(block.timestamp));
    } 

    /// @notice function to get single product transfer information
    function getProduct(uint _smId) public view returns(supplierManufacturer memory){
        return smIdToStructMapping[_smId];
    }


    /// @notice function to request product from supplier
    function requestproduct(uint _spId,address _supplierAddress,uint _quantity) public
    {
        reqIdToDetailsMapping[reqId] =requestDetails(_spId,_supplierAddress,msg.sender,_quantity);
        supplierToRequestMapping[_supplierAddress].push(reqId);
        manufacturerToRequestMapping[msg.sender].push(reqId);
        reqId++;
    }


    /// @notice funtion to get all request from a manufacturer
    function getSupplierRequests(address _supplierAddress) public view returns(requestDetails[] memory)
    {
        requestDetails[] memory allRequestDetails = new requestDetails[](reqId);
        uint[] memory reqIds = supplierToRequestMapping[_supplierAddress];
        for(uint i=0;i<reqIds.length;i++)
        {
            allRequestDetails[i] = reqIdToDetailsMapping[reqIds[i]];
        }
        return allRequestDetails;
    }

    /// @notice funtion to get all request of  manufacturer
    function getManufacturerRequests(address _manufacturerAddress) public view returns(requestDetails[] memory)
    {
        requestDetails[] memory allRequestDetails = new requestDetails[](reqId);
        uint[] memory reqIds = manufacturerToRequestMapping[_manufacturerAddress];
        for(uint i=0;i<reqIds.length;i++)
        {
            allRequestDetails[i] = reqIdToDetailsMapping[reqIds[i]];
        }
        return allRequestDetails;
    }

    /// @notice function to get all trasnfers manufacturer has received
    function getAllSmIdForManufacturer(address _manufacturerAddress) public view returns(supplierManufacturer[] memory){
        uint[] memory smIdData = manufacturerTosmIdMapping[_manufacturerAddress];
        supplierManufacturer[] memory smIdDetails = new supplierManufacturer[](smIdData.length);
        for(uint i=0;i<smIdData.length;i++)
        {
            smIdDetails[i] = smIdToStructMapping[smIdData[i]];
        }
        return smIdDetails;
    }
}

contracts/Interfaces/ISupplierManufactur.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <=0.8.19;

interface ISupplierManufacturer {
  struct supplierManufacturer{
      uint spId;
      address supplierAddress;
      address manufacturerAddress;
      uint32 dispatchTime;
      uint32 arrivalTime;
  }

  struct requestDetails{
      uint spId;
      address supplierAddress;
      address manufacturerAddress;
      uint quantity;
  }

  event eventSupplierManufacturerTransfer(uint indexed _smId,uint indexed _spId, address _supplierAddress,address _manufacturerAddress,uint32 _dispatchTime);
  event eventArrivalTime(uint32 _arrivalTime);
  
  function transferProduct(uint _spId, address _supplierAddress,address _manufacturerAddress,uint32 _dispatchTime)external;
  function receiveProduct(uint smId)external;
}

